import React from 'react';
const Shop = (props) => {

    return (
        <div>

            <h1>Products</h1>
            <div className='products'>
            {props.data.map((item, index) => (
                <div key={index} className='product-item'>
                <h3>{item.name}</h3>
                <h4>${item.cost}</h4>
                <img src={item.image} alt={item.name}/>
                <br/>
                <button onClick={() => props.addToCart(item)}>Add to Cart</button>
                </div>
            ))}
            </div>
        </div>
    )
}

export default Shop;
